window.bookSummaryJSON = "<p><b>Eizo is a middle-aged, overworked software engineer who loves cats.</b></p> <p>One night after working late, he saves an injured cat from a speeding truck. The cat survives, but Eizo does not...</p> <p>Luckily, that cat turns out to be a god-like being who offers him a second chance in another world! Eizo decides that he wants a slower life, one where he can live off the things he creates with his own hands. So, why not become a blacksmith? He does have one other stipulation: a cat companion for his quiet life.</p> <p>These requests are granted, and Eizo is whisked away to a new world and imbued with blacksmithing knowledge. He soon finds out that his abilities are above average—in fact, his new skills are so overpowered that they're like cheats. On top of that, his cat companion turns out to be a half-tiger girl!</p> <p>Eizo's blades soon garner attention, and he realizes that he can turn the tides of battle with his forge and hammer. With so much commotion in store, will Eizo truly be able to enjoy a quiet life?</p> <p>Text copyright 2019 by Tamamaru, Kinta. Translated from the original Japanese by Linda Liu. English translation edited by C.D. Leeson. Originally published in English by J-Novel Club. First published in Japan in 2019 by Kadokawa Corporation. English translation rights arranged with Kadokawa Corporation.</p>"; 
